func renderNodeItem(w http.ResponseWriter, itemType api.NodeItemDataType, o interface{}) {
	s, err := json.Marshal(o)
	if err != nil {
		itemType = api.NodeItemError
		s = []byte(err.Error())
	}

	writeNodeItem(w, itemType, s)
}

func writeNodeItem(w http.ResponseWriter, itemType api.NodeItemDataType, s []byte) {
	w.Write(append([]byte(itemType+" "), append(s, '\n')...))
}

func TestBlockFetcher(t *testing.T) {
	st := block.InitTestBlockchain()
	defer st.Close()

	kp := keypair.Random()
	_, _, localNode := network.CreateMemoryNetwork(nil)

	ep, _ := common.NewEndpointFromString("https://node1?NodeName=n1")
	v, _ := node.NewValidator(kp.Address(), ep, "n1")

	localNode.AddValidators(v)
	cm := &mockConnectionManager{
		allConnected: []string{kp.Address()},
	}

	bk := block.GetLatestBlock(st)
	bt, err := block.GetBlockTransaction(st, bk.Transactions[0])
	require.NoError(t, err)
	tp, err := block.GetTransactionPool(st, bt.Hash)
	require.NoError(t, err)
	bt.Message = tp.Message

	apiHandlerFunc := func(req *http.Request) (*http.Response, error) {
		w := httptest.NewRecorder()
		renderNodeItem(w, api.NodeItemBlock, bk)

		tp, _ := block.GetTransactionPool(st, bt.Hash)
		bt.Message = tp.Message

		renderNodeItem(w, api.NodeItemBlockTransaction, bt)
		resp := w.Result()
		return resp, nil
	}

	cli := mockDoer{
		handleFunc: apiHandlerFunc,
	}

	f := NewBlockFetcher(cm, cli, st, localNode)
	f.logger = log

	ctx := context.Background()
	nodelist := &NodeList{}
	nodelist.SetLatestNodeAddrs([]string{kp.Address()})
	si, err := f.Fetch(ctx, &SyncInfo{Height: 1, NodeList: nodelist})
	require.NoError(t, err)
	require.Equal(t, bk.Hash, si.Block.Hash)
	require.Equal(t, bk.TransactionsRoot, si.Block.TransactionsRoot)
}

